			.header {
				height: 35vh;

				background-color: #222222de;
			}
			.header > img {
				object-fit: contain;
				height: 18vh;
				max-width: 80vw;
			}
			.header > h3 {
				margin: 0;
				font-family: Inter;
				font-size: 3.5vh;
				color: #fff;
			}
			.header > h3 > span {
				color: #f5deb3;
			}
			.header > h3 > span::after {
				content: '|';
				display: inline-block;
				width: 0;
				margin: 0 0.1vw 0 -0.1vw;
				animation: cursor 0.7s steps(1) infinite;
			}
			@keyframes cursor {
				50% {
					opacity: 0;
				}
			}
			.buttons {
				margin-top: 10vh;
				gap: 1vh;
			}
			.buttons > img {

		<script>
			'use strict';
			window.eaglercraftXOpts = {
				container: 'game_frame',
				assetsURI: 'assets.epk',
				joinServer: new URLSearchParams(window.location.search).get('server') || null,
			};
			function shuffleIndices(n) {
				const arr = [...Array(n).keys()];
				for (let i = n - 1; i > 0; i--) {
					const j = Math.floor(Math.random() * (i + 1));
					[arr[i], arr[j]] = [arr[j], arr[i]];
				}
				return arr;
			}
			const textData = {
				type: () => {
					if (textData.currentWordOrder === null) textData.currentWordOrder = shuffleIndices(textData.words.length);
					const currentWord = textData.words[textData.currentWordOrder[textData.wordIndex]];
					if (!textData.isDeleting) {
						document.querySelector('.header > h3 > span').textContent = currentWord.substring(0, textData.letterIndex++);
						if (textData.letterIndex > currentWord.length) {
							textData.isDeleting = true;
							textData.timeoutReference = setTimeout(() => textData.type(), 1000);
							return;
						}
					} else {
						document.querySelector('.header > h3 > span').textContent = currentWord.substring(0, textData.letterIndex--);
						if (textData.letterIndex < 0) {
							textData.isDeleting = false;
							if (++textData.wordIndex > textData.words.length - 1) {
								do {
									textData.currentWordOrder = shuffleIndices(textData.words.length);
								} while (textData.currentWordOrder[0] === textData.wordIndex - 1);
								textData.wordIndex = 0;
							}
							textData.timeoutReference = setTimeout(() => textData.type(), 500);
							return;
						}
					}
					textData.timeoutReference = setTimeout(() => textData.type(), 150);
				},
				words: ['fully modded', 'fresh experience', 'non-skidded', 'community endorsed', 'one-and-only modded', 'not georged', 'from real devs', 'team built'],
				currentWordOrder: null,
				wordIndex: 0,
				letterIndex: 0,
				isDeleting: false,
				timeoutReference: null,
			};
			function playGame() {
				if (window.location.protocol === 'file:') {
					alert('HTTP please, do not open this file locally, run a local HTTP server and load it via HTTP');
				} else if (document.readyState !== 'complete') {
					alert('Please wait for the game to finish loading.');
				} else {
					clearTimeout(textData.timeoutReference);
					document.head.removeChild(document.head.querySelector('style'));
					document.body.innerHTML = '';
					document.head.querySelector('meta[name="viewport"]').setAttribute('content', 'width=device-width, initial-scale=1.0, minimum-scale=1.0, maximum-scale=1.0');
					document.documentElement.removeAttribute('lang');
					document.documentElement.setAttribute('style', 'width:100%;height:100%;background-color:black;');
					document.body.setAttribute('style', 'margin:0px;width:100%;height:100%;overflow:hidden;background-color:black;');
					document.body.setAttribute('id', 'game_frame');
					window.main();
				}
			}
			document.addEventListener('DOMContentLoaded', () => textData.type());
		</script>
